struct UnicodeInfo {
	Index<dword>                      composed;
	Index<Tuple<dword, dword, dword>> decomposed;
	int                               canonical_count;
	Index<dword>                      lower;
	Index<dword>                      upper;
	Index<dword>                      rtl;
	Index<dword>                      letter;
	Index<dword>                      islower;
	Index<dword>                      isupper;
	Index<dword>                      ismark;
	
	void Load(const Vector<dword>& data, Index<dword>& x, int& offset);
	
	UnicodeInfo();
};

void UnicodeInfo::Load(const Vector<dword>& data, Index<dword>& x, int& offset)
{
	int count = data[offset];
	for(int i = 0; i < count; i++)
		x.Add(data[i + 1 + offset]);
	x.Shrink();
	offset += count + 1;
}

UnicodeInfo::UnicodeInfo()
{
	String ds = ZDecompress(unicode_info__, sizeof(unicode_info__));

	Vector<dword> data;
	dword prev = 0;
	StringStream ss(ds);
	while(!ss.IsEof()) {
		byte ch = ss.Get();
		dword val;
		if(ch < 255) {
			val = prev + ch - 127;
		}
		else {
			val = ss.Get();
			val |= ss.Get() << 8;
			val |= ss.Get() << 16;
			val |= ss.Get() << 24;
			val = prev + val - 127;
		}
		data.Add(val);
		prev = val;
	}
	
	int count = canonical_count = data[0];
	count += data[1];
	for(int i = 0; i < count; i++) {
		composed.Add(data[i + 2]);
		decomposed.Add(MakeTuple(data[i + count + 2], data[i + 2 * count + 2], data[i + 3 * count + 2]));
	}
	composed.Shrink();
	decomposed.Shrink();

	int offset = 4 * count + 2;
	
	count = data[offset];
	for(int i = 0; i < count; i++) {
		lower.Add(data[i + 1 + offset]);
		upper.Add(data[i + count + 1 + offset]);
	}
	lower.Shrink();
	upper.Shrink();
	offset += 2 * count + 1;

	Load(data, rtl, offset);
	Load(data, letter, offset);
	Load(data, islower, offset);
	Load(data, isupper, offset);
	Load(data, ismark, offset);
}

int UnicodeDecompose(dword codepoint, dword t[MAX_DECOMPOSED], bool& canonical)
{ // TODO: Add hangul support
	UnicodeInfo& f = Single<UnicodeInfo>();
	
	int q = f.composed.Find(codepoint);
	if(q >= 0) {
		const Tuple<dword, dword, dword>& d = f.decomposed[q];
		t[0] = d.a;
		t[1] = d.b;
		t[2] = d.c;
		canonical = q < f.canonical_count;
		return d.c ? 3 : 2;
	}
	t[0] = codepoint;
	return 1;
}

int UnicodeDecompose(dword codepoint, dword t[MAX_DECOMPOSED])
{
	bool dummy;
	return UnicodeDecompose(codepoint, t, dummy);
}

dword UnicodeCompose(dword *t, int count)
{
	if(count < 1 || count > 3)
		return 0;
	if(count == 1)
		return t[0];
	Tuple<dword, dword, dword> x;
	x.a = t[0];
	x.b = t[1];
	x.c = count == 3 ? t[2] : 0;
	UnicodeInfo& f = Single<UnicodeInfo>();
	int q = f.decomposed.Find(x);
	return q >= 0 && q < f.canonical_count ? f.composed[q] : 0;
}

dword ToUpperRest_(dword c)
{
	UnicodeInfo& f = Single<UnicodeInfo>();
	int q = f.lower.Find(c);
	return q >= 0 ? f.upper[q] : c;
}

dword ToLowerRest_(dword c)
{
	if(c == 0x1e9e) // Capital sharp S -> small sharp S (but not reverse direction)
		return 0xdf;
	if(c == 0x2126) // Ohm sign -> small greek omega
		return 0x3c9;
	if(c == 0x212a) // Kelvin sign -> k
		return 'k';
	if(c == 0x212b) // Angstrom sign
		return 0xe5;
	if(c == 0xa64a) // CYRILLIC CAPITAL LETTER MONOGRAPH UK
		return 0xa64b;
	UnicodeInfo& f = Single<UnicodeInfo>();
	int q = f.upper.Find(c);
	return q >= 0 ? f.lower[q] : c;
}

dword ToAsciiRest_(dword c)
{
	UnicodeInfo& f = Single<UnicodeInfo>();
	int q = f.composed.Find(c);
	if(q < 0)
		return 0;
	int ch = f.decomposed[q].a;
	return ch < 128 ? ch : 0;
}

bool IsRTL_(dword c)
{
	return Single<UnicodeInfo>().rtl.Find(c) >= 0;
}

bool IsLetter_(dword c)
{
	return Single<UnicodeInfo>().letter.Find(c) >= 0;
}

bool IsLower_(dword c)
{
	return c != ToUpper((int)c) || Single<UnicodeInfo>().islower.Find(c) >= 0;
}

bool IsUpper_(dword c)
{
	return c != ToLower((int)c) || Single<UnicodeInfo>().isupper.Find(c) >= 0;
}

bool IsMark_(dword c)
{
	return Single<UnicodeInfo>().ismark.Find(c) >= 0;
}

